import { composeWithDevTools } from 'redux-devtools-extension'
import reducer from './reducers/anecdoteReducer'
import { createStore } from 'redux'

const Store = () => {
  return(
    createStore(
    reducer,
    composeWithDevTools()
  )
)
}

export default Store
